import React, { useEffect, useState } from 'react';
import { fetchEntries } from '../Services/TripService';
import { DataView, DataViewLayoutOptions } from 'primereact/dataview';
import {Skeleton} from 'primereact/skeleton'
import { Tag } from 'primereact/tag';
import { Button } from 'primereact/button';
import {Rating} from 'primereact/rating'
import { Dialog } from 'primereact/dialog';

const TripsView = () => {
  const [entries, setEntries] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [visible, setVisible] = useState(false);
  const [selectedEntry, setSelectedEntry] = useState(null);

  useEffect(() => {
    fetchEntries()
      .then((data) => {
        const sortedEntries = data.sort((a, b) => new Date(a.startDate) - new Date(b.startDate));
        setEntries(sortedEntries);
        setLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching entries:', error);
        setError(error);
        setLoading(false);
      });
  }, []);

  const getCardClassName = (startDate, endDate) => {
    const now = new Date();
    const start = new Date(startDate);
    const end = new Date(endDate);

    if (start > now) {
      return 'future-trip';
    } else if (end < now) {
      return 'past-trip';
    } else {
      return 'current-trip';
    }
  };

  // Define a skeleton template for loading state
  const skeletonTemplate = () => (
    <div className="col-12 sm:col-6 lg:col-12 xl:col-4 p-2">
      <div className="p-4 border-1 surface-border surface-card border-round">
        <Skeleton className="w-6rem border-round h-1rem" />
        <Skeleton className="w-3rem border-round h-1rem" />
        <div className="flex flex-column align-items-center gap-3 py-5">
          <Skeleton className="w-9 shadow-2 border-round h-10rem" />
          <Skeleton className="w-8rem border-round h-2rem" />
          <Skeleton className="w-6rem border-round h-1rem" />
        </div>
        <div className="flex align-items-center justify-content-between">
          <Skeleton className="w-4rem border-round h-2rem" />
          <Skeleton shape="circle" className="w-3rem h-3rem" />
        </div>
      </div>
    </div>
  );
  const tripTemplate = (trip) => {
    return (
      <div className="col-12 sm:col-6 lg:col-12 xl:col-4 p-2" key={trip.id}>
        <div className="p-4 border-1 surface-border surface-card border-round">
          <div className="flex flex-wrap align-items-center justify-content-between gap-2">
            <div className="flex align-items-center gap-2">
              <i className="pi pi-calendar"></i>
              <span className="font-semibold">{trip.startDate} - {trip.endDate}</span>
            </div>
            {/* getSeverity(trip) */}
            <Tag value={trip.status} severity='danger'></Tag>
          </div>
          <div className="flex flex-column align-items-center gap-3 py-5">
            <img
              className="w-9 shadow-2 border-round"
              src={`https://localhost:44393/${trip.coverPhotoUrl}`}
              alt={trip.title}
            />
            <div className="text-2xl font-bold">{trip.title}</div>
            <Rating value={trip.rating} readOnly cancel={false}></Rating>
          </div>
          <div className="flex align-items-center justify-content-between">
            <Button
              icon="pi pi-plus"
              className="p-button-rounded"
              onClick={() => console.log('open je')}
            > View Journal</Button>
          </div>
        </div>
      </div>
    );
  };

  // const tripTemplate = (entry) => {
  //   const cardClassName = getCardClassName(entry.startDate, entry.endDate);
  //   const cardStyles = {
  //     width: '16rem',
  //     height: '16rem',
  //     // border: cardClassName === 'current-trip' ? '4px solid orange' : cardClassName === 'past-trip' ? '4px solid red' : '4px solid green',
  //     cursor: 'pointer',
  //     backgroundImage: `url('https://localhost:44393/${entry.coverPhotoUrl}')`,
  //     backgroundSize: 'cover',
  //     backgroundPosition: 'center',
  //     color: 'white',
  //     position: 'relative',
  //   };

  //   const headerStyles = {
  //     position: 'absolute',
  //     top: '0',
  //     left: '0',
  //     width: '100%',
  //     // backgroundColor: cardClassName === 'current-trip' ? 'orange' : cardClassName === 'past-trip' ? 'red' : 'green',
  //     padding: '0.5rem',
  //     fontSize: '1rem',
  //     fontWeight: 'bold',
  //     color: 'white',
  //     zIndex: '1',
  //   };
    
  //   const handleClick = () => {
  //     setSelectedEntry(entry);
  //     setVisible(true);
  //   };

  //   return (
  //     <Card className="trip-card" style={cardStyles} onClick={handleClick}>
  //       <div style={headerStyles}>
  //         {entry?.title}
  //         <p style={{ color: 'white', fontSize: '0.8rem', marginTop: '0.5rem' }}>
  //           {new Date(entry?.startDate).toLocaleDateString()} - {new Date(entry?.endDate).toLocaleDateString()}
  //         </p>
  //       </div>
  //       <div className="p-card-content">
  //         {/* Optionally add more content below the header for each trip */}
  //       </div>
  //     </Card>
  //   );
  // };

  const onHide = () => {
    setVisible(false);
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh' }}>
      {entries.length > 0 ? (
  <DataView value={entries} itemTemplate={tripTemplate} layout={'grid'} />
):(
  // {skeletonTemplate}
  null
)}
       <Dialog visible={visible} onHide={onHide}>
        {selectedEntry && (
          <>
            <h3>{selectedEntry}</h3>
            </>)}
         </Dialog>

</div>)}
export default TripsView;
